function secToTime(t){
	let h=Math.floor(t/3600);
	t-=h*3600;
	let m=Math.floor(t/60);
	t-=m*60;
	return (h>0?h+'ั ':'')+(m>0?m+'ะผ ':'')+Math.round(t)+'ั'
}
